INSERT INTO `home_project` VALUES (87,2022,'517105','Work Over HBK',1,5929561.41,1624068,881522.4,48843,130296,76021,1011818.4,124864,2869034,896247,1558572,602957,707782,217198,710538,225973,723548,225973,727166,227103,'\"Clôture 2021: L\'écart positif s\'explique par l\'augmentation du nombre de workover, 04 au lieu de 03  initialement prévues, il s\'agit de deux (02) PIE OKN 341 et OKN 441 au lieu d\'un (01) PPH OKN721 suite à l\'annulation de la candidature en GLC.                                                                                                                                       Initial 2022: Cinq (05) opérations  de Work over programmées.     PMTE 2022  2026 : L\'écart positif s\'explique par l\'augmentation de trois (03) opérations dans le  PMTE 2022-2026 (23 au lieu de 20 opérations).                      \"',2,22,25,6,0,490137.01),(89,2022,'517A','Acidification',1,498481.10748999997,197533,13786.3,0,17332,6000,31118.3,6000,399798,165533,49456,26000,91554,38362,91554,39129,108345,44021,108345,44021,'\"Clôture 2021 :  Ecart négatif s\'explique par la réduction d\'une opération d\'acidification et chagement de nature des trois (03) puits PPH par trois (03) puits PIE  dont le coût de réalisation  reduit par rapport aux puits PPH. Initial 2022 :  Le nombre d\'opérations de stimulation prevu est de six (06) Acidifications. PMTE  2022  2026 : Ecart négatif dû à la réduction du nombre d\'acidifications (08 opérations) dans le  PMTE 2022-2026 (54 au lieu de 62 opérations). \"',2,22,25,6,0,18108.80749),(90,2022,'517F','Fracturation',1,711969.88385,475635,0,0,91876,74384,91876,74384,425204,326867,91876,74384,126144,95934,126144,97853,86458,66540,86458,66540,'\"Clôture 2021 :   L\'écart négatif est dû à la planification de deux (02) Opérations au lieu de trois (03) et transfert d\'une opération sur périmètre EAA-GLO (EAAN4), (Réf Fax: N°882/HBK/21).. Initial 2022:  programmation de deux (02) opérations. PMTE  2022  2026 : Le nombre des opérations est maintenu (16). Ecart positif dû à la préparation du puits OKN17 en vue d\'une opération de fracturation hydraulique, réalisée en fin d\'année 2020 (PMTE 2022-2026).\"',2,22,25,6,0,103013.88385),(91,2022,'5176051X','WO mise en conformité puits abandonnés HBK',1,1478292.47214,121772,144977.8,13335,868090,73857,1013067.8,87192,0,0,264932,34580,0,0,0,0,0,0,0,0,'\"Clôture 2021 : Même programme physique trois (03) opérations sur OKJ10,OKJ60 et OKNH4. Initial 2022:  Programmation d\'une (01) opération sur OKJ02. PMTE  2022  2026 : Ecart positif dû à l\'ajout de deux (02) opérations sur les puits OKNH4 en 2021 et OKJ02 en 2022 (PMTE 2022-2026).\"',2,22,25,6,0,200292.67214),(92,2022,'517309','Trait. Bourbiers et résidus  HBK',1,330000,0,0,0,0,0,0,0,287100,0,42900,0,165000,0,122100,0,0,0,0,0,'\"- le DAO a été transmis au Département Juridique Alger afin de l\'introduire à la  CMA en date du 28/06/2021. - Le lancement de DAO est prévu pour le troisieme trimestre de l\'année 2021 - Signature du contrat et de l\'ODS est prévue dans le premier trimestre de l\'année 2022  - PMT 22-26 coût global maintenu. \"',3,22,25,6,0,0),(93,2022,'5176041','Snubbing HBK',1,2461902.11627,488178,113418.8,0,135805,31937,249223.8,31937,1579137,386476,286457,69765,393384,96883,397418,97852,390917,93889,397418,97852,'\"Clôture 2021:  L\'écart négatif s\'explique par  la réduction de cinq (05) opérations (15 au lieu de 20 opérations).                                                                                                   Initial 2022 : Programmation de dix huite (18) Opérations.    PMTE  2022  2026 : L\'écart positif est dû aux Changements des garnitures 1\'\'660 , non prévues dans la réalisation 2020 et la cloture 2021 (PMTE 2022-2026), et la revalorisation de prix 2\'\'7/8.\"',2,22,25,6,0,347084.31627),(94,2022,'517336','Collectes huile HBK',1,33165,0,0,0,0,0,0,0,0,0,33165,0,0,0,0,0,0,0,0,0,'\"Cloture 2021: Initialement prévu le raccordement d\'un puits HBKx reporté au Fevrier 2022 suite au